\begin{equation}
\begin{array}{ccc}
(y_j-x)^2 					&	< 		&	(y_k-x)^2\\
y_j^2 + x^2- 2y_j x 		&	< 		&	y_k^2 + x^2- 2y_k x\\
\frac{1}{2} y_j^2 - y_j x 	&	< 		&	\frac{1}{2} y_k^2 - y_k x\\
x(y_k -y_j) - \frac{1}{2} \left(y_k^2 -y_j^2 \right) 	&	< 		&	0\\
(y_k -y_j)\left(x - \frac{1}{2} \left(y_k + y_j \right)\right) 	&	< 		&	0
\end{array}
\end{equation}
